-- texts
update `quest_template` set `OfferRewardText` = 'Here in Stormwind, I am responsible for putting paladins on the path to greater virtue as they devote themselves to the Light and defend Azeroth from the Scourge and other threats.$B$BThe time has come for you to take your first step towards being truly virtuous. If you accept it, I will give you a Book of Divinity. In studying it, you shall learn some about the Light, and what is expected of you. If you understand it, and are capable, then you will succeed in attaining greater abilities.' where `entry` = 1641;
update `quest_template` set `OfferRewardText` = 'Here in Ironforge, I am responsible for putting paladins on the path to greater virtue as they devote themselves to the Light and defend Azeroth from the Scourge and other threats.$B$BThe time has come for you to take your first step towards being truly virtuous. If you accept it, I will give you a Book of Divinity. In studying it, you shall learn some about the Light, and what is expected of you. If you understand it, and are capable, then you will succeed in attaining greater abilities.' where `entry` = 1645;
update `quest_template` set `OfferRewardText` = 'Hello again, $N. How goes your studies of the Tome of Divinity?$B$BThen you should be prepared to have yourself tested. There are always tasks to be done throughout the city and our lands; acts of compassion and understanding; people who need help; creatures to slay.$B$BBy proving you have the patience to help others, especially those who are less fortunate, you prove that you are a servant of the Light and of sound mind.' where `entry` = 1642;
update `quest_template` set `OfferRewardText` = 'Oh, hello, luv. How go your adventures? Oh, I\'m so glad to hear you\'re doing well.$B$BOh, me? Thank you for asking--I\'m doing well, all things considered.$B$BThe increase in tradesmen has kind of put a damper on the amount of leather and cloth people are willing to part with these days, so it\'s been tougher to make clothing for the children at the orphanage, but we\'ll manage. By "we" I mean my husband and I. He\'s up in Ironforge trying to seek help from the citizens there.' where `entry` = 1643;
update `quest_template` set `OfferRewardText` = 'You\'ve returned so quickly, $N. And what have you accomplished in your time away from the Cathedral?$B$BHave you helped a noble cause? Perhaps you\'ve learned the value of charity or some more about your obligations to the citizens of Azeroth. Tell me, who have you helped and how... Well, I\'m impressed, $N, those are surely the actions of one who follows the Light and values others above oneself.$B$BSuch sacrifice will always be rewarded in time.' where `entry` = 1780;
update `quest_template` set `OfferRewardText` = '*cough*$B$BPleasure to meet you, $R. Don\'t mind my wounds, the good priest here can take care of ol\' Gazin this time. I won\'t be needing the power of that Symbol of Life you\'ve got there... not yet anyway.$B$BSo, Duthorian sent you to speak to me, huh? Fair enough. I\'ll tell you exactly what befell me and my friend Henze. And with any luck, and some skill on your part, perhaps you can still help us all.' where `entry` = 1781;
update `quest_template` set `OfferRewardText` = 'Thank you, brother.$B$BSeeing you wield the Symbol of Life, may I assume Duthorian or Gazin sent you?$B$BI fell to the Defias spell casters while Gazin and I tried to get their plans from them: I was able to hold on long enough to allow Gazin to escape, but in the end, their magics overwhelmed me.$B$BBut you were able to bring me back: the ability to use the Symbol doesn\'t come to just anyone, $N. It bodes well for you that you were able to empower it with your own faith.' where `entry` = 1786;
update `quest_template` set `OfferRewardText` = 'You\'ve done well this day, $N. You should take some pride in what you\'ve accomplished.$B$BEven more so, you should be proud of your abilities. Not everyone can use the power of the Symbol of Life. Calling upon the Light to bring back the dead means you\'re prepared for one of the $C\'s greatest honors: the power of resurrection.$B$BYou shall have the power to bring back fallen companions much like you did for Henze.$B$BBe well, $N. The Light shines upon you and you should welcome it wholly.' where `entry` = 1788;
update `quest_template` set `OfferRewardText` = 'Make haste, $N, more than one life hangs in the balance if you fail.$B$BIf for some reason you fail to help Muiredon and Narm, then return to me and I will give you another Symbol of Life for your travels.$B$BDon\'t mistake my aid as simple charity, you must prove yourself worthy like any other $C and continual failure may reflect upon you later.' where `entry` = 1789;
update `quest_template` set `OfferRewardText` = 'Make haste, $N, more than one life hangs in the balance if you fail.$B$BIf for some reason you fail to help Gazin and Henze, then return to me and I will give you another Symbol of Life for your travels.$B$BDon\'t mistake my aid as simple charity, you must prove yourself worthy like any other $C and continual failure may reflect upon you later.' where `entry` = 1790;
update `quest_template` set `OfferRewardText` = 'Welcome back, $N. You\'ve spent time reading the book, I hope?$B$BThen you should be prepared to have yourself tested. There are always tasks to be done throughout the city and our lands; acts of compassion and understanding; people who need help; creatures to slay.$B$BBy proving you have the patience to help others, especially those who are less fortunate, you prove that you are a servant of the Light and of sound mind.' where `entry` = 1646;
update `quest_template` set `OfferRewardText` = 'THE ORPHANAGE OF STOR... oh, sorry, didn\'t mean to shout at you, sir.$B$BMy name is John Turner. How are you?$B$BGood, good, glad to hear things go well for you. I\'ve had a long day of work already, and I miss my wife terribly, but that\'s the price you have to pay when there are mouths to feed and backs to clothe.' where `entry` = 1647;
update `quest_template` set `OfferRewardText` = 'So, you\'ve returned so quickly, huh? And what pray tell have you accomplished in your time away from here?$B$BWere you able to help a noble cause? Perhaps you\'ve learned the value of charity or some more about your obligations to the citizens of Azeroth. Tell me, who have you helped and how.... Impressive, $N, those are surely the actions of one who follows the Light.$B$BSuch sacrifice will always be rewarded in time.' where `entry` = 1778;
update `quest_template` set `OfferRewardText` = '*cough*$B$BGood day to ya, $C. Don\'t mind me wounds, the good priest \'ere\'ll take care of ol\' Muiredon in time. Not needin\' the power of that Symbol of Life ya got there quite yet.$B$BSo, me wife sent ya o\'er to speak to me, huh? Fair \'nough. I\'ll take the time to talk to ya-I\'ll tell ya exactly wut happened to Muiredon and his best friend Narm, a $C jus\' like yerself.' where `entry` = 1779;
update `quest_template` set `OfferRewardText` = 'You\'ve done all of Ironforge a great favor today, $N. I\'m proud to count you among us, and if you feel you\'re ready, I would like to bless you with this scroll. The Symbol of Life would only have worked when used by a <class> who was ready for one of the Light\'s greatest blessings-the power to restore the dead back to life.$B$BI will teach you the ability to resurrect your companions. Use it wisely, $N, and thank you, on behalf of myself, my husband, and Ironforge.' where `entry` = 1785;
update `quest_template` set `OfferRewardText` = 'Welcome, young initiate. That you have answered my summons so promptly bodes well for you.$B$BLet us dispense with pleasantries, then, as they are best left to courtiers and their ilk.$B$BYour rapid progress has caught my attention, $N. We will see if you have taken your lessons to heart.' where `entry` = 9677;
update `quest_template` set `OfferRewardText` = 'Welcome back, initiate. Now that you know the truth about the source of our power and you have demonstrated your skill in wielding it, I will grant you the ability to resurrect the fallen in the field.$B$BStay true to the order and excel at your training and you will only continue to grow in power.' where `entry` = 9685;

